import React from 'react';
import {Redirect, Route} from 'react-router-dom';

export const PrivateRoute = ({isAuthed, ...rest}) => {
    debugger
    if (!isAuthed){
        return <Redirect to="/login" />;
    }
    return <Route {...rest} />;
}
